  "Allegations" : "NASD RULES 2110 AND 3040:  IN MAY 2008, WHILE REGISTERED WITH HIS MEMBER FIRM, MITCHELL, ACTING ON BEHALF OF HIS OUTSIDE BUSINESS ACTIVITY, PARTICIPATED IN PRIVATE SECURITIES TRANSACTION BY ENTERING INTO A PROMISSORY NOTE IN THE AMOUNT OF $395,000 WITH HIS FIRM CLIENT, IN VIOLATION OF THE FIRM'S POLICIES.  AT ALL TIMES RELEVANT, THE FIRM'S POLICIES SPECIFICALLY PROHIBITED REGISTERED REPRESENTATIVES FROM ENGAGING IN PRIVATE SECURITIES TRANSACTIONS, REGARDLESS OF WHETHER THEY RECEIVED COMPENSATION FOR EFFECTING THE TRANSACTION. THE PROCEDURES ALSO NOTED THAT PROMISSORY NOTES ARE OFTEN SECURITIES AND THAT REGISTERED REPRESENTATIVES ARE NOT PERMITTED TO PARTICIPATE IN ANY OUTSIDE BUSINESS ACTIVITY INVOLVING THE SALE OF PROMISSORY NOTES.  MOREOVER, THE PROCEDURES PROHIBITED REPRESENTATIVES FROM ACCEPTING LOANS FROM CLIENTS.",
